var datamain={lists:[]};function getData(){$.ajax({url:AppURL.main,type:"GET",dataType:"json",cache:!0,complete:function(a){var t=a.responseJSON.data_searchresult;datamain.lists=t.lists,builfLists(datamain.lists),t.bgimg&&setTimeout(function(){$("body").css({"background-image":"url("+t.bgimg+")"})},200)}})}function builfLists(a){for(var t=0;t<a.length;t++){var i=a[t].split(";"),s=i[2];1==s?$(".lists").append('<a class="btn btn-primary ml-2 mt-2 mb-1" href="./giaidacbiet.html" target="_blank">'+i[1]+"</a>"):2==s?$(".lists").append('<a class="btn btn-primary ml-2 mt-2 mb-1" href="./giainhat.html" target="_blank">'+i[1]+"</a>"):3==s?$(".lists").append('<a class="btn btn-primary ml-2 mt-2 mb-1" href="./giainhi.html" target="_blank">'+i[1]+"</a>"):4==s&&$(".lists").append('<a class="btn btn-primary ml-2 mt-2 mb-1" href="./giaikhuyenkhich.html" target="_blank">'+i[1]+"</a>")}}getData();